                    <input onChange={handlePasswordChange} type="password" className="form-input" placeholder="Password" />
                </div>
                <div className="form-group">
                    <input onChange={handleConfirmPasswordChange} type="password" className="form-input" placeholder="Confirm Password" />
                </div>
                <button type="submit" className="submit-button">Register</button>
            </form>
        </div>
    );
}
